import React from 'react';
import './App.css';
import Card from './Card'

function Cards(props) {
    // const mapdata=props.data
    const mapdata=[
        {
            ProductID:123,
            Name:'Shoes',
            Model:'Nike',
            Price:69
        },
        {
            ProductID:123,
            Name:'Shoes',
            Model:'Nike',
            Price:69
        },
        {
            ProductID:123,
            Name:'Shoes',
            Model:'Nike',
            Price:69
        }
    ]
    console.log(mapdata)
        function cardsRender(item)
        {
            return(
            <Card key ={item.ProductID} name={item.Name} model={item.Model} price={item.Price}/>
            )
        } 
    return (
        <div className="App">
        {mapdata.map(cardsRender)}
        </div>
    )
    }

export default Cards;
